",\"namePlural\":\"Receiving Yards\"}},{\"category\":{\"id\":29,\"abbreviation\":\"TD\",\"nameSingular\":\"Offensive + Special Teams TD\",\"namePlural\":\"Offensive + Special Teams TDs\"}}],\"transactionStatus\":{\"locked\":{},\"isLineupStatusLocked\":true},\"requestedGamesPeriod\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"viewingFormat\":\"TOTAL\",\"viewingRange\":{\"low\":-1,\"high\":-2},\"displayGroup\":\"RUSHER\",\"lastX\":[{\"duration\":1},{\"duration\":3},{\"duration\":5}]},\"team\":{\"id\":1374255,\"name\":\"Mushroom City Karts\",\"logoUrl\":\"https://s3.amazonaws.com/fleaflicker/t1374255_0_150x150.jpg\",\"initials\":\"MC\"}}},{\"timeEpochMilli\":\"1540980000000\",\"transaction\":{\"type\":\"TRANSACTION_CLAIM\",\"player\":{\"proPlayer\":{\"id\":13653,\"nameFull\":\"Taysom Hill\",\"nameShort\":\"T. Hill\",\"proTeamAbbreviation\":\"NO\",\"position\":\"QB/WR\",\"headshotUrl\":\"https://d26bvpybnxg29h.cloudfront.net/nfl/13653.png\",\"nflByeWeek\":6,\"news\":[{\"timeEpochMilli\":\"1606081525000\",\"contents\":\"Hill completed 18 of 23 pass attempts for 233 yards, adding 10 rushes for 51 yards and two touchdowns during Sunday's 24-9 win against the Falcons. He also lost one fumble.\",\"analysis\":\"With Drew Brees (ribs) potentially out through Week 15, Coach Sean Payton elected not to turn to Jameis Winston and his 80 career starts against Atlanta. Instead, he entrusted the swiss-army knife talent Hill in his quarterback slot. On fantasy servers where Hill maintained tight end eligibility for Week 11, he proved to be an absolute gold mine. Even if entrusted in a QB slot, however, the BYU product still cashed in with his 284 scrimmage yards and two scores. His positional eligibility will be revisited after the Week 11 slate, but he offers tremendous upside with his rushing acumen heading into a matchup against the Broncos.\",\"title\":\"Effective in starting QB debut\"},{\"timeEpochMilli\":\"1606060026000\",\"contents\":\"New Orleans Saints quarterback Taysom Hill was confirmed as the starting signal-caller by head coach Sean Payton ahead of the Week 11 contest with the Falcons. In typical Payton fashion, New Orleans waited until two hours before kickoff to officially announce the starter, but the mind games are finally over. Reports had suggested that Hill would be the starter, though it's always nice to get the official word. It's anyone's guess how the 30-year old will do, as he's very unproven as a passer. ...\",\"url\":\"https://www.rotoballer.com/player-news/taysom-hill-confirmed-as-starting-quarterback/806713\",\"title\":\"Taysom Hill Confirmed As Starting Quarterback\"}],\"nameFirst\":\"Taysom\",\"nameLast\":\"Hill\",\"proTeam\":{\"abbreviation\":\"NO\",\"location\":\"New Orleans\",\"name\":\"Saints\"},\"positionEligibility\":[\"QB\",\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6304,\"away\":{\"abbreviation\":\"ATL\",\"location\":\"Atlanta\",\"name\":\"Falcons\"},\"home\":{\"abbreviation\":\"NO\",\"location\":\"New Orleans\",\"name\":\"Saints\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"awayScore\":9,\"homeScore\":24,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"WIN\",\"awayResult\":\"LOSE\"},\"stats\":[{\"category\":{\"id\":12,\"abbreviation\":\"%\",\"nameSingular\":\"Completion Percentage\",\"namePlural\":\"Completion Percentage\"},\"value\":{\"value\":78.26087,\"formatted\":\"18/23\"}},{\"category\":{\"id\":3,\"abbreviation\":\"Yd\",\"nameSingular\":\"Passing Yard\",\"namePlural\":\"Passing Yards\"},\"value\":{\"value\":233.0,\"formatted\":\"233\"}},{\"category\":{\"id\":5,\"abbreviation\":\"TD\",\"nameSingular\":\"Passing TD\",\"namePlural\":\"Passing TDs\"},\"value\":{\"formatted\":\"0\"}},{\"category\":{\"id\":7,\"abbreviation\":\"INT\",\"nameSingular\":\"Interception\",\"namePlural\":\"Interceptions\",\"lowerIsBetter\":true},\"value\":{\"formatted\":\"0\"}},{\"category\":{\"id\":175,\"abbreviation\":